import React, { Component } from 'react';
import ReCAPTCHA from 'react-google-recaptcha';

class NewCard extends Component {
  onChange = (value) => {
    console.log("Captcha value:", value);
  }
  render() {
    return (
      <ReCAPTCHA
        sitekey="Your client site key"
        onChange={onChange}
      />
    );
  }
}
export default Robot;
